import React from 'react';
import bloglogo from '../../assets/Images/bloglogo.png';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBIcon,  MDBAnimation } from "mdbreact";
import '../../assets/Styles/Styles.css';

export default class Navbar extends React.Component {

    state = {
        isOpen: false
      };

      toggleCollapse = () => {
        this.setState({ isOpen: !this.state.isOpen });
      }


    render() {
        return (

                <MDBNavbar color="grey" dark="true" expand="md" fixed="top" >
        <MDBNavbarBrand>
        <a href="/"> <img src={bloglogo} alt="Livrite Healthcare" className="img-fluid bloglogo"  /></a>

        </MDBNavbarBrand>
        <MDBNavbarToggler onClick={this.toggleCollapse} />
        <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>

          <MDBNavbarNav right> 
          <MDBNavItem >
              <MDBNavLink to="/"><strong>Home</strong></MDBNavLink>
            </MDBNavItem>
            <MDBNavItem>
              <MDBNavLink to="/"><strong>Technology</strong></MDBNavLink>
            </MDBNavItem>
            <MDBNavItem>
              <MDBNavLink to="/"><strong>Health</strong></MDBNavLink>
            </MDBNavItem>
            <MDBNavItem>
              <MDBNavLink to="/"><strong>Science</strong></MDBNavLink>
            </MDBNavItem>
            <MDBNavItem>
              <MDBNavLink to="/"><strong>Agri</strong></MDBNavLink>
            </MDBNavItem>
            <MDBNavItem active>
              <MDBNavLink to="/"> <MDBAnimation type="bounceIn" duration="2s" infinite><strong>BimRec Portal</strong></MDBAnimation> </MDBNavLink>
            </MDBNavItem>             
            <MDBNavItem>
            <a href="http://twitter.com/livritehealth" className="nav-link Ripple-parent" target='_blank'><MDBIcon fab icon="twitter"/></a>

            </MDBNavItem>
            <MDBNavItem>
            <a href="http://instagram.com/livritehealth" className="nav-link Ripple-parent" target='_blank'><MDBIcon fab icon="instagram" /></a>

            </MDBNavItem>
            <MDBNavItem>
            <a href="http://linkedin.com/company/livrite-healthcare-services" className="nav-link Ripple-parent" target='_blank'><MDBIcon fab icon="linkedin" /></a>

            </MDBNavItem>
            <MDBNavItem>
            <a href="https://www.facebook.com/livritehealth" className="nav-link Ripple-parent" target='_blank'><MDBIcon fab icon="facebook" /></a>
            </MDBNavItem>
          </MDBNavbarNav>
        </MDBCollapse>
      </MDBNavbar>

        );
    }
}
